import './ContactBanner.css';

import { Link } from 'react-router-dom';
import Container from 'react-bootstrap/Container';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';

function ContactBanner(props) {
  return (
    <div className={`contact-banner__container
      ${props.background === 'yellow' ? 'contact-banner__yellow' : ''}
      ${props.background === 'neutral' ? 'contact-banner__neutral' : ''}
      ${props.background === 'beige' ? 'contact-banner__beige' : ''}
      ${props.background === 'green' ? 'contact-banner__green' : ''}
    `}>
      <Container>
        <Row>
          <Col xs={12} md={8}>
            <label className="eyebrow primary-rust">{props.eyebrow ? props.eyebrow : 'PARTNER WITH US'}</label>
            <h2 className="header2 contact-banner__header">{props.header ? props.header : 'We work with different kinds of partners. Are you one of them?'}</h2>
          </Col>

          <Col xs={12} md={4} className="text-center">
            <Link to="/contact">
              <button className="button contactBanner__btn">Contact Us</button>
            </Link>
          </Col>
        </Row>
      </Container>
    </div>
  );
}

export default ContactBanner;
